import React from 'react';

import {ListGroup} from 'react-bootstrap';

function usedAuthority(){
    return(
        
    <ListGroup>
         <ListGroup.Item>Batches</ListGroup.Item>
         <ListGroup.Item>sale</ListGroup.Item>
         <ListGroup.Item>Report</ListGroup.Item>
         <ListGroup.Item>tax</ListGroup.Item>
         <ListGroup.Item>bill</ListGroup.Item>
    </ListGroup>
    
   
    );
}
export default usedAuthority;
